Acabei de conhecer o Chatbot Arena, é brilhante. Ele permite que você compare e classifique a produção de mais de 25 LLMs diretamente do seu navegador. Em seguida, ele coleta as pontuações para construir uma classificação dos principais modelos fechados/abertos.

Aqui estão algumas conclusões interessantes:

✔ OpenAI continua sendo o rei dos LLMs;

✔ Modelos fechados ainda superam os modelos abertos (mas a lacuna está diminuindo);

✔ Mistral 8x7b é o melhor modelo de código aberto no momento - Yi-34B está voando sob o radar.

